import React, { useState, useEffect } from 'react';
import axios from 'axios';

function Download() {

    const [dws, setDws] = useState(null);
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState(null);

    useEffect(() => {

        const fetchDws = async () => {
            try {
                setError(null);
                setDws(null);

                setLoading(true);
                const response = await axios.get('http://192.168.1.211:8080/api/download');
                setDws(response.data.data);
            } catch (e) {
                setError(e);
            }
            setLoading(false);
        };

        fetchDws();
    }, []);

    if (loading) return <div>Loading...</div>;
    if (error) return <div>An error occurred</div>;
    if (!dws) return null;

    const txt ="설치 가이드\n[Read] [Download]";
    return (
        <div className="card">
            <h2 id="download"><font color="#0066ff">&#9483; </font>Download</h2>
            <table>
                <tbody>
                    <tr>
                        <th class="row-proct">Product</th>
                        <th class="row-download">Download</th>
                        <th class="row-guide">Guide</th>
                    </tr>
                    {dws.map(dw => (
                        <tr>
                            <td>
                                <strong>{dw.product}</strong>
                            </td>
                            <td clospan="2">
                                <a class="d1" href={dw.file_name} target="_blank">64bit</a>
                            </td>
                            <td>
                                {}
                               <string>설치 가이드</string> 
                               <span dangerouslySetInnerHTML={{__html: "[Read] [Download]"}}></span>
                            </td>
                            <td>
                               <string>업데이트 가이드</string> 
                               [Read] [Download]
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}

export default Download;
